DECLARE @RS10 TABLE(BF_SSN VARCHAR(9))

DECLARE @RS05 TABLE(BF_SSN VARCHAR(9))

SELECT DISTINCT RS10.BF_SSN FROM @RS10 RS10 WHERE RS10.BF_SSN NOT IN (SELECT DISTINCT RS05.BF_SSN FROM @RS05 RS05)
SELECT DISTINCT RS05.BF_SSN FROM @RS05 RS05 WHERE RS05.BF_SSN NOT IN (SELECT DISTINCT RS10.BF_SSN FROM @RS10 RS10)